import classes from './NewForm.module.css'
import Card from '../ui/Card';

function NewForm() {
    return <Card>
        <form>
            <div>
                <label htmlFor='title'>Location Address</label>
                <input type='text' required id='title'/>
            </div>
        </form>

    </Card>
}

export default NewForm;
